      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          style={{ height: "500px" }}
          src={I7}
          alt=""
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          style={{ height: "500px" }}
          src={I6}
          alt=""
        />
      </Carousel.Item>
    </Carousel>
  );
}

export default Carousels;
